window.bookSummaryJSON = "<p><b>Ara</b></p> <p>Revenge was meant to be sweet.</p> <p>Instead, I've drawn the attention of a monster.</p> <p>I'm at his mercy.</p> <p>He knows my secret. But only part of it.</p> <p>Time is ticking, and only one of us is going to walk out of this alive.</p> <p><b>Luca</b></p> <p>Ara is my stalker, but I've become obsessed.</p> <p>She has more curves and beauty than she has a right to.</p> <p>I'm going to break her.</p> <p>I want to cut open and figure out that brilliant mind of hers.</p> <p>Especially when I suspect she's trying to underhand everything I've built.</p> <p><i>This is an enemies-to-lovers, mafia, dark romance standalone.</i></p>"; 
